<item>
<title>2007-09-10 14:03:04</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardFormsLotsCards/CardsCardAdd/show&amp;time=2007-09-10+14%3A03%3A04</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardFormsLotsCards/CardsCardAdd&amp;amp;v=1b0d" class="">/Ambs&amp;nbsp;Cards&amp;nbsp;Manual&amp;nbsp;/&amp;nbsp;Card&amp;nbsp;Forms&amp;nbsp;Lots&amp;nbsp;Cards&amp;nbsp;/&amp;nbsp;Cards&amp;nbsp;Card&amp;nbsp;Add&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardFormsLotsCards/CardsCardAdd&amp;amp;time=2007-09-10+14%3A03%3A04">2007-09-10 14:03:04&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardFormsLotsCards/CardsCardAdd&amp;amp;time=2007-09-10+14%3A27%3A38">2007-09-10 14:27:38&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">3. Выбрать в&amp;nbsp;поле «Cards generate» режим создания карточек: &lt;strong>group&lt;/strong>;&lt;br />
Для&amp;nbsp;того что&amp;nbsp;бы&amp;nbsp;добавить новую карточку в&amp;nbsp;состав лота, следует выполнить следующие действия:&lt;br />
3. Выбрать в&amp;nbsp;поле «Cards generate» режим создания карточек: &lt;strong>single&lt;/strong>;&lt;br />
4. В&amp;nbsp;поле «Authorization type» выбрать тип&amp;nbsp;авторизации создаваемой карты;&lt;br />
5. В&amp;nbsp;поле «Amount» указать количество единиц на&amp;nbsp;этой карте;&lt;br />
6. В&amp;nbsp;поле «Manual pin()» указать префикс создаваемой карты;&lt;br />
7. В&amp;nbsp;поле «Manual key()» указать пин-ключ создаваемой карты; &lt;br />
8. В&amp;nbsp;поле «Max. sessions» указать количество одновременных звонков создаваемой карты;&lt;br />
9. В&amp;nbsp;поле «Category» выбрать категорию создаваемой карты; &lt;br />
10. Нажать кнопку «Apply change» чтобы добавить карты.&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">3. Выбрать в&amp;nbsp;поле «Cards generate» режим создания карточек: группа;&lt;/div>&lt;/div>
</description>
</item>
